import React from 'react';
import { Link } from 'react-router-dom';
import './App.css'; // CSSファイルのインポート

export const Header = () => {
    return(
        <div>
            <Link to='/'>Top</Link>
            <ul>
                <li className="mdx-heading mt-0 text-primary dark:text-primary-dark -mx-.5 break-words text-5xl font-display font-bold leading-tight"><Link to='/theme'>テーマ</Link></li>
            </ul>
        </div>
    )
}
